        "productTips": "大象肥\n                            / 慢慢买",
        "productInfo": "嘉实多百配汇通专卖店天猫精选 嘉实多 金嘉护10w-40 机油 sn级4L*2桶正品包邮预售价格329元，支付定金50元抵90元，需在双11当天付清尾款，最后实付299元包邮，还可以领取店内20元优惠券，价格更低，需要的慢友可以关注。Castrol 嘉实多机油中目前常见的产品包括采用全合成技术的极护系列、采用半合成技术的磁护系列和矿物质油金嘉护系列，产品定位也是从高到低依次排列。这款嘉实多Castrol 金嘉护GTX 10W-40矿物质机油为入门款，采用了抗油泥配方，保护发动机抵抗油泥带来的损害，能在发动机启动瞬间吸附在发动机内部的表面，形成特殊的保护油膜。这样在对发动机损耗最大的前10分钟内能更好的保护发动机，减少磨损，维持长久寿命。适用于大多数低中档欧美轿车。下面普及下机油标号的含义：类似5W-30字样，包含两个数字，前者表示机油的低温黏度等级，后者表示高温粘稠等级。0W表示可在-35℃的环境下使用，10W表示：-35℃+10℃=-25℃下使用，依此类推。W前的数字越小低温流动性能越好，低温冷启动越容易。机油的低温性能好坏影响汽车的燃油经济性、低温启动性。后面的数字表示在100℃时机油的黏度，数字越大黏度越高，生成的油膜强度更高，对高温工作下的发动机保护越好。简而言之，前面的数字越小越好，而后面的数字则要根据汽车的具体情况来选择，通常5W-30或5W-40或0W-40的全合成机油比较常见。",
